DROP TABLE IF EXISTS `soal`;
CREATE TABLE `soal`  (
  `id_soal` int(11) NOT NULL AUTO_INCREMENT,
  `id_mapel` int(11) NOT NULL,
  `nomor` int(5) NULL DEFAULT NULL,
  `soal` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `jenis` int(1) NULL DEFAULT NULL,
  `pilA` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `pilB` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `pilC` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `pilD` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `pilE` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `jawaban` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `file` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `file1` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `fileA` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `fileB` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `fileC` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `fileD` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `fileE` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  PRIMARY KEY (`id_soal`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 702 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

