INSERT INTO `soal` VALUES (474, 9, 1, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Beberapa komputer yang terhubung melalui media tansmisi dengan aturan tertentu sehingga dapat berkomunikasi satu dengan yang lainnya adalah pengertian dari ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Kumpulan Komputer</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Kelompok Komputer</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Jaringan Komputer</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Jaringan Perangkat</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Kumpulan Perangkat</span></p>', 1, '', '', '', '', '', 'C', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (475, 9, 2, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Membawa informasi secara cepat tanpa ada kesalahan dari sisi pengirim (transmitter) menuju penerima (receiver) melalui media komunikasi adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Manfaat Jaringan Komputer</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Tujuan Jaringan Komputer</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Permasalahan Jaringan Komputer</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Fungsi Jaringan Komputer</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Pengertian Jaringan Komputer</span></p>', 1, '', '', '', '', '', 'A', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (476, 9, 3, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Aturan baku / standar yang digunakan untuk dapat saling berkomunikasi antar perangkat jaringan / telekomunikasi disebut dengan&hellip;</span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm9\">A. Tata tertib jaringan </span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm9\">B. Undang-undang </span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm9\">C. Protokol jaringan</span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm9\">D. Etika Jaringan</span></p>\r\n<p class=\"Normal tm8\"><span class=\"tm9\">E. jaringanSandi Jaringan</span></p>', 1, '', '', '', '', '', 'C', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (477, 9, 4, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Model jaringan pada jaringan komputer yaitu ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Client Server dan Star</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Client Server dan Peer To Peer</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Peer To Peer dan Star</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Peer To Peer dan Topologi</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Topologi dan Client Server</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (478, 9, 5, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Model jaringan yang menggunakan prinsip pelayan dan yang dilayani adalah model jaringan ....</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Client Server</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Peer To Peer</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Star</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Bus </span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Tree</span></p>', 1, '', '', '', '', '', 'A', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (479, 9, 6, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Jaringan komputer yang memiliki jangkauan 100 m &ndash; 2 KM adalah jaringan ....</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. LAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. MAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. WAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Internet</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Peer To Peer</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (480, 9, 7, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Jaringan yang merupakan gabungan dari beberapa jaringan LAN yang saling terhubung satu sama lainnya adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm9\"><span class=\"tm7\">A. LAN</span></p>\r\n<p class=\"DaftarParagraf tm9\"><span class=\"tm7\">B. MAN</span></p>\r\n<p class=\"DaftarParagraf tm9\"><span class=\"tm7\">C. WAN</span></p>\r\n<p class=\"DaftarParagraf tm9\"><span class=\"tm7\">D. Internet</span></p>\r\n<p class=\"DaftarParagraf tm9\"><span class=\"tm7\">E. Peer To Peer</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (481, 9, 8, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Gambar dibawah ini merupakan contoh dari jaringan ....</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\"><img src=\"data:image/png;base64,\" /></span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. LAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. MAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. WAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Internet</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Peer To Peer</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (482, 9, 9, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Kabel yang digunakan untuk menghubung komputer yang satu dengan yang lainnya dalam jaringan adalah kabel ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Kabel Antena</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Adapter</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Kabel UTP</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Kabel Serat</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Kabel Kawat</span></p>', 1, '', '', '', '', '', 'C', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (483, 9, 10, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Dibawah ini adalah peralatan &ndash; peralatan yang digunakan untuk praktek instalasi kabel jaringan, kecuali ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Tang Crimping</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Tester LAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Kabel UTP</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. RJ 45</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Gunting</span></p>', 1, '', '', '', '', '', 'E', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (484, 9, 11, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Jenis kabel yang susunannya berbeda adalah ....</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Cross Over</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Straigh </span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Roll Over</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Type A</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Type B</span></p>', 1, '', '', '', '', '', 'A', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (485, 9, 12, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Jenis kabel yang digunakan untuk menghubungkan perangkat jaringan yang berbeda adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Cross Over</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Straigh </span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Roll Over</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Type A</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Type B</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (486, 9, 13, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Jenis kabel yang digunakan untuk menghubungkan komputer ke router adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. Cross Over</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Straigh </span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. Roll Over</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Type A</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Type B</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (487, 9, 14, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Gambar alat dibawah ini adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm6\"><span class=\"tm7\"><img src=\"data:image/png;base64,\" /></span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. RJ 45</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Tester LAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. HUB</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Tang Crimping</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Kabel UTP</span></p>', 1, '', '', '', '', '', 'A', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (488, 9, 15, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Gambar alat dibawah ini adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm6\"><span class=\"tm7\"><img src=\"data:image/png;base64,\" /></span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. RJ 45</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Tester LAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. HUB</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Tang Crimping</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Kabel UTP</span></p>', 1, '', '', '', '', '', 'D', '', '', '', '', '', '', '');
INSERT INTO `soal` VALUES (489, 9, 16, '<p class=\"DaftarParagraf tm6\"><span class=\"tm7\">Gambar alat dibawah ini adalah ...</span></p>\r\n<p class=\"DaftarParagraf tm6\"><span class=\"tm7\"><img src=\"data:image/png;base64,\" /></span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">A. RJ 45</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">B. Tester LAN</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">C. HUB</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">D. Tang Crimping</span></p>\r\n<p class=\"DaftarParagraf tm8\"><span class=\"tm7\">E. Kabel UTP</span></p>', 1, '', '', '', '', '', 'B', '', '', '', '', '', '', '');
