INSERT INTO `soal` VALUES (491, 9, 18, '<p class=\"Normal tm5\"><span class=\"tm6\">Keuntungan topologi jaringan STAR adalah sebagai berikut, kecuali&hellip;</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">A. Paling fleksibel</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">B. Pemasangan / perubahan stasiun sangat mudah</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">C. Kontrol terpusat</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">D. Hemat kabel</span></p>\r\n<p class=\"Normal tm7\"><span class=\"tm6\">E. Kemudahan deteksi dan isolasi kerusakan pengelolaan jaringan</span></p>', 1, '', '', '', '', '', 'D', '', '', '', '', '', '', '');
