INSERT INTO `soal` VALUES (519, 11, 6, 'Pengertian topologi jaringan komputer adalah ....', 1, ' Suatu cara menghubungkan komputer yang satu dengan komputer lainnya sehingga membentuk jaringan.', ' Node – node dihubungkan secara serial sepanjang kabel, dan pada kedua ujung kabel ditutup dengan Node Node dihubungkan secara serial sepanjang kabel, dan pada kedua ujung kabel ditutup dengan terminator.', ' Setiap node berkomunikasi langsung dengan konsentrator', ' Node-node dihubungkan secara serial di sepanjang kabel, dengan bentuk jaringan seperti lingkaran.', '', 'A', '', '', '', '', '', '', '');
